import React from "react";
import { Container } from "react-bootstrap";

const Contact = () => {
  return (
    <>
      <Container
        className="services-section mt-5 pt-5"
        style={{ bakgroundColor: "#7F7EC7" }}
      ></Container>
    </>
  );
};

export default Contact;
